/*DELETE EXCEPTION records that have latest updates from Source*/ DELETE FROM $$EXCEPDB.EX_XXOA_ORDER_ATTRIB EXOA WHERE EXISTS (SELECT 1 FROM $$NRTSTGDB.ST_UO_XXOA_ORDER_ATTRIB SOA WHERE EXOA.OA_ATTRIB_ID = SOA.OA_ATTRIB_ID AND EXOA.GLOBAL_NAME = SOA.GLOBAL_NAME) OR EXISTS (SELECT 1 FROM $$NRTSTGDB.ST_BO_XXOA_ORDER_ATTRIB SOA WHERE EXOA.OA_ATTRIB_ID = SOA.OA_ATTRIB_ID AND EXOA.GLOBAL_NAME = SOA.GLOBAL_NAME) ;
/* Q1FY15 CR */ DELETE FROM $$NRTSTGDB.WI_SOL_OFFER_ATTRIB_DELS WHERE GLOBAL_NAME IN ('UO', 'BO');
/* Q1FY15 CR - OA Populate DELETES */ INSERT INTO $$NRTSTGDB.WI_SOL_OFFER_ATTRIB_DELS SELECT STOA1.OA_ATTRIB_ID , STOA1.SS_CD , STOA1.GLOBAL_NAME , STOA1.SOURCE_COMMIT_TIME FROM( SELECT STOA.OA_ATTRIB_ID, NSSC.SOURCE_SYSTEM_CODE AS SS_CD, STOA.GLOBAL_NAME, STOA.SOURCE_COMMIT_TIME FROM $$NRTSTGDB.ST_UO_XXOA_ORDER_ATTRIB STOA INNER JOIN $$COMREFVWDB.N_SOURCE_SYSTEM_CODES NSSC ON NSSC.GLOBAL_NAME = STOA.GLOBAL_NAME WHERE STOA.SOURCE_DML_TYPE = 'DELETE' QUALIFY ROW_NUMBER () OVER (PARTITION BY STOA.OA_ATTRIB_ID ORDER BY STOA.SOURCE_COMMIT_TIME DESC, REFRESH_DATETIME DESC)=1
UNION ALL
